import { Button, Pagination, Row, Col } from 'antd';
import React from 'react';
import APP from '../components/App';
import CHARACTOR from '../components/Charactor';
import ABOUT from '../components/About';
import HELP from '../components/Help';
import MenuBar from '../components/Menu';
import styled from 'styled-components';

const dd = styled.div`
    width: 100%;
    height: 75px;
    background: #FA5A5A;  /* fallback for old browsers */
    background: -webkit-linear-gradient(to right, #f80759, #FA5A5A);  /* Chrome 10-25, Safari 5.1-6 */
    background: linear-gradient(to right, #f80759, #FA5A5A); /* W3C, IE 10+/ Edge, Firefox 16+, Chrome 26+, Opera 12+, Safari 7+ */

`;


const Index = () => {
    return (
        <div style={{fontFamily:'Noto Sans KR'}}>
            
            <APP/>
            <ABOUT />
            <CHARACTOR />
            <HELP />
            <dd style={{position: 'fixed', height: '75px', display:'flex', width: '100%', top:0, left:0, right: 0}}><MenuBar/></dd>
        </div>
    );
};

export default Index;
